import Button from "react-bootstrap/Button";

function Delete({ handleDelete, index }) {
  return (
    <div style={{ backgroundColor: "gray" }}>
      <Button
        style={{ width: "5rem" }}
        onClick={() => handleDelete(index)}
        variant="outline-danger"
      >
        Delete
      </Button>
    </div>
  );
}

export default Delete;
